import React from "react";

export default function Contact() {
  return (
    <div>
      <div class="card">
        <img src="https://w7.pngwing.com/pngs/340/946/png-transparent-avatar-user-computer-icons-software-developer-avatar-child-face-heroes-thumbnail.png" class="card-img-top" alt="..." />
        <div class="card-body">
          <h3 class="card-title">Mark Anderson</h3>
          <p class="card-text">What time did react lesson start today?</p>
          <a href="#" class="btn btn-primary">
            Start Chat
          </a>
        </div>
      </div>
    </div>
  );
}
